var Profile = (function() {
    var email = "null";

    var getEmail = function() {
      return email;    // Or pull this from cookie/localStorage
    };

    var setEmail = function(eml) {
        email = eml;     
      // Also set this in cookie/localStorage
    };

    return {
      getEmail: getEmail,
      setEmail: setEmail
    }

  })();

  export default Profile;
